import Bar from './Bar';

function Navbar() {
    return (
        <nav className='container1' role="navigation" aria-label="Main navigation">
      <div className='upper'>
        <div className='bar'>
          <Bar />
        </div>
      </div>
    </nav>
  );
}

import './navbar.css';
export default Navbar;
